                // Check if query is present in top frequent queries
                if (topFrequentQueries.contains(t._1())) {
                    // Check if it's first time the system would count this as a cache miss
                    // If it's first time, send a request to retrieve such query and cache in the memory for 12 hours
                    // Then next time the same query comes, it would be a cache hit
