                    return true;
                } else {
                    return false;
                }
            }
        });

        // Calculate cache hit rate
        double cacheHitRate = cacheHits.count() / onsiteDataWithQuery.count();

        System.out.println("Cache Hit Rate: " + cacheHitRate);
    }
}
